import React from "react";
import Box from "./Box";
import styled from "styled-components";

const StyledBoard = styled.div`
  display: flex;
  flex-wrap: wrap;
  justify-content: space-around;
`;

const Board = () => {
  return (
    <StyledBoard>
      <Box />
      <Box />
      <Box />
      <Box />
      <Box />
      <Box />
      <Box />
    </StyledBoard>
  );
};

export default Board;
